import './App.css';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import Home from './pages/Home';
import About from './pages/About';
import Contact from './pages/Contact';
import Products from './pages/Products';


function App() {
  return (
    <Router>
      <div className="App">
        <nav className="navbar">
          <div className="logo" style={{display: 'flex', alignItems: 'center', gap: '0.7rem'}}>
            <img
              src={require('./images/logo-main.jpg')?.default || require('./images/logo-main.png')?.default || require('./images/logo-main.svg')?.default}
              alt="Logo"
              style={{width: 36, height: 36, borderRadius: 8, boxShadow: '0 1px 4px rgba(44,62,80,0.10)'}}
              onError={e => {
                e.target.onerror = null;
                e.target.src = '';
                e.target.style.display = 'none';
              }}
            />
            SSE Home Decor
          </div>
          <ul className="nav-links">
            <li><Link to="/">Home</Link></li>
            <li><Link to="/about">About</Link></li>
            <li><Link to="/products">Products</Link></li>
            <li><Link to="/contact">Contact</Link></li>
          </ul>
        </nav>
        <div className="content">
          <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/about" element={<About />} />
            <Route path="/products" element={<Products />} />
            <Route path="/contact" element={<Contact />} />
          </Routes>
        </div>
      </div>
    </Router>
  );
}

export default App;
